  [],\n\t\"revision_timestamp\": \"2016-10-29T18:58:00.011704\",\n\t\"name\": \"range-wide-surveys-for-prairie-butterfly-species-of-concern\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Final report on a project to determine
  the status and current range of the Dakota skipper (Hesperia dacotae) and Poweshiek
  skipperling (Oarisma poweshiek) within five Wetland Management Districts (WMD) in
  North and South Dakota.  The five WMD's in this study are Sand Lake, Waubay, Tewaukon,
  Madison, and Kulm.  Inventories for at risk and other prairie butterfly species
  at historical and high priority sites were inventoried during the 2012 flight.  Information
  on presence or absence of at risk species will be used to formulate management plans
  that will ensure the sustainability of known populations and contribute to the health
  of prairie habitats. Surveys will also provide specific and timely data for Section
  7 Intra-Service consultations or conferences as needed.\",\n\t\"license_title\":
